    true,nt"url": null,nt"notes": "The After-School Programs at Public Elementary
    Schools, 2008 (FRSS 91), is a study that is part of the Fast Response Survey System
    (FRSS) program; program data is available since 1998-99 at <http://nces.ed.gov/surveys/frss/downloads.asp>.
    FRSS 91 (http://nces.ed.gov/surveys/frss/) is a sample survey that provides a national
    profile of various types of formal after-school programs physically located at public
    elementary schools in 2008. These programs include stand-alone programs that focus
    primarily on a single type of service (e.g., only day care) and broad-based programs
    that provide a combination of services such as academic enrichment and cultural
    activities. The study was conducted using surveys via web or by mail. Principals
    of public elementary schools were sampled. The study's weighted response rate was
    91 percent. Key statistics produced from FRSS 91 were program focus (if applicable),
    number of students enrolled, hours per week the program operates, availability of
    transportation for students, whether students from other schools attend the program,
    and factors that may hinder students from participating in the program.",nt"license_title":
